import React from 'react';
import { BrowserRouter as Router, Route, Routes, Link } from 'react-router-dom';
import RegistrarFuncionario from './RegistrarFuncionario';
import VerFuncionarios from './VerFuncionarios';
import EditarFuncionario from './EditarFuncionario';
import RegistrarEntradaSalida from './RegistrarEntradaSalida'; // Importar el nuevo componente

const App = () => {
    return (
        <Router>
            <nav>
                <ul>
                    <li><Link to="/registrar">Registrar</Link></li>
                    <li><Link to="/ver">Ver Funcionarios</Link></li>
                    <li><Link to="/editar">Editar Funcionarios</Link></li>
                    <li><Link to="/registro">Registrar Entrada/Salida</Link></li> {/* Nueva ruta */}
                </ul>
            </nav>
            <Routes>
                <Route path="/registrar" element={<RegistrarFuncionario />} />
                <Route path="/ver" element={<VerFuncionarios />} />
                <Route path="/editar" element={<EditarFuncionario />} />
                <Route path="/registro" element={<RegistrarEntradaSalida />} /> {/* Nueva ruta */}
            </Routes>
        </Router>
    );
};

export default App;
